  background: #000;
  color: #fff;
  padding: 5px 10px;
  border-radius: 5px;

  display: none;
}

  width: 14px;
  height: 14px;
  border-radius: 50%;
  background: #fff;
  position: absolute;
  left: 10px;
  top: 5px;
}
.pdb-popup:after {
  content: " ";
  display: block;
  width: 10px;
  height: 10px;
  background: #ff0;
  position: absolute;

  -o-transform: rotate(45deg);
  transform: rotate(45deg);

  top: 50%;
  margin-top: -5px;
}
.pdb-popup.left:after {
  right: -5px;
}
.pdb-popup.right:after {
  left: -5px;
}
.pdb-popup.float {
  position: absolute;
  top: 100px;
  left: 100px;
  background: #fff;
  border: 1px solid #ccc;
  box-shadow: 0 2px 2px rgba(0,0,0,0.3);
  border-radius: 2px;
  min-width: 100px;

  margin: 0 0 2px 0;
  width: 100%;

.pdb-popup.float .desc {
  font-weight: bold;
  font-size: 0.8em;

}

.pdb-root {
  position: relative;
  width: 100%;
  height: 100%;
  margin: 0;
  font-family: verdana;
  box-sizing: border-box;
  padding-bottom: 0;
}
.pdb-root svg {
  display: block;
}
.pdb-renderer .pdb-root {
  padding-bottom: 0;
}
.pdb-title {
  text-align: center;
}
/* deprecated START */
.pdb-legend {
  text-align: center;
}
.pdb-legend .entry {
  display: inline-block;
  padding: 5px 15px 5px 5px;
  margin-right: 5px;
  cursor: pointer;
}
.pdb-legend .entry:hover {
  background: rgba(255,255,255,0.5);
  -ms-transform: scale(1.2);
  -moz-transform: scale(1.2);
  -webkit-transform: scale(1.2);
  -o-transform: scale(1.2);
  transform: scale(1.2);
}
.pdb-legend .entry .marker {
  display: inline-block;
  width: 14px;
  height: 14px;
  border-radius: 50%;
  vertical-align: middle;
  margin-right: 5px;
}
.pdb-legend .entry .name {
  display: inline-block;
  vertical-align: middle;
}
/* deprecated END */
.pdb-root.editing text {
  -webkit-touch-callout: none;
  -webkit-user-select: none;

  -moz-user-select: none;
  -ms-user-select: none;
  user-select: none;
}
.hover-box,
.hover-margin {
  position: absolute;
  z-index: 99999;
  pointer-events: none;
}
.hover-box {
  border: 1px dashed #f00;
}
.hover-margin {
  border: 1px dashed rgba(255,192,0,0.5);
}
.selection-box {
  position: absolute;
  border-radius: 3px;
  border: 1px solid rgba(92,92,240,0.8);
  background: rgba(92,92,240,0.3);
}
.pdb-popup {
  position: absolute;
  background: #000;
  color: #fff;
  padding: 5px 10px;
  border-radius: 5px;
  box-sizing: content-box;
  display: none;
}
.pdb-popup.marker {
  width: 14px;
  height: 14px;
  border-radius: 50%;
  background: #fff;
  position: absolute;
  left: 10px;
  top: 5px;
}
.pdb-popup:after {
  content: " ";
  display: block;
  width: 10px;
  height: 10px;
  background: #ff0;
  position: absolute;
  -ms-transform: rotate(45deg);
  -moz-transform: rotate(45deg);
  -webkit-transform: rotate(45deg);
  -o-transform: rotate(45deg);
  transform: rotate(45deg);
  background: #000;
  top: 50%;
  margin-top: -5px;
}
.pdb-popup.left:after {
  right: -5px;
}
.pdb-popup.right:after {
  left: -5px;
}
.pdb-popup.float {
  position: absolute;
  top: 100px;
  left: 100px;
  background: #fff;
  border: 1px solid #ccc;
  box-shadow: 0 2px 2px rgba(0,0,0,0.3);
  border-radius: 2px;
  min-width: 100px;
  max-width: 300px;
  min-height: 12px;
  padding: 5px 5px;
  display: none;
  text-align: center;
  color: #000;
  font-size: 0.8em;
}
@media (max-width: 480px) {
  .pdb-popup.float {
    max-width: 90%;
  }
}
.pdb-popup.float:after {
  display: none;
}
.pdb-popup.float .title {
  font-size: 1.15em;
  font-weight: normal;
  margin: 0 0 2px 0;
  width: 100%;
}
.pdb-popup.float .desc {
  font-weight: bold;
  font-size: 0.8em;
  margin: 0;
  margin-bottom: 5px;
}
.axis .domain {
  fill: none;
}
.pdb-popup.float .value {
  font-size: 0.9em;
}

#plotdb-fullscreen {

  width: auto;

</div><div style="position: absolute; top: 0px; left: 0px; width: 100%; height: 100%; z-index: -1;"><div style="position: absolute; inset: 0px; z-index: -1; overflow: hidden; visibility: hidden;"><div style="position: absolute; inset: 0px; z-index: -1; overflow: hidden; visibility: hidden;"><div style="position: absolute; left: 0px; top: 0px; transition: all 0s ease 0s; width: 1000000000px; height: 1000000000px;"></div></div><div style="position: absolute; inset: 0px; z-index: -1; overflow: hidden; visibility: hidden;"><div style="position: absolute; left: 0px; top: 0px; transition: all 0s ease 0s; width: 200%; height: 200%;"></div></div></div></div></div><script type="text/javascript">var chart = {"ownername":"40402018e","key":24145,"name":"多粉對談","owner":9309,"theme":null,"parent":2145,"description":"「多粉對談」是一場社會實驗，在2020年台灣總統大選前，我們安排兩位各持不同立場的陌生人，面對面進行一場理性交流的對話，異溫層的人們，真的如同我們的想像嗎？","basetype":["99"],"visualencoding":["99"],"category":["4"],"tags":[],"likes":2,"searchable":true,"dimlen":0,"createdtime":"2019-12-31T07:43:25.000Z","modifiedtime":"2020-01-03T14:59:31.000Z","doc":{"name":"document","size":1289,"type":"html","lines":57,"content":"<div class=\"bg second-circle\"><\/div>\n<div class=\"bg first-circle\"><\/div>\n<img  class=\"bg third-circle\" src=\"https://tynnie.github.io/conversation/assets/img/bg.svg\">\n# 多粉對談\n\n異溫層的人，有沒有可能好好坐下來，面對面展開一場理性的對話？\n\n\n* [觀看完整內容](https://newmedia.pts.org.tw/fans-talk/)\n* 測驗多粉指數 (2)\n\n\n<img src=\"https://newmedia.pts.org.tw/fans-talk-interactive/images/kv.gif\" alt=\"\">\n\n## (1)  \n\n這些他粉真的和你想像的一樣嗎？<br>快來看看多粉對談的影片，一起認識他們真正的樣子吧！\n\n* [點我看影片](https://newmedia.pts.org.tw/fans-talk/)\n\n\n## (2) 測驗多粉指數\n\n選舉要到了，你支持哪位總統候選人呢？\n\n* ![Song](Song.png) <br>我是宋粉(3)\n* ![Han](Han.png) <br>我是韓粉(3)\n* ![Tsai](Tsai.png)<br>我是英粉 (3)\n\n## (3) \n\n身為他的粉絲，你曾經跟與你立場不同的粉絲 / 親友聊過政治嗎？\n\n* 有 (4)\n* 沒有 (6)\n\n## (4)\n\n你們當時聊的愉快嗎？\n\n* 很不錯 (5)\n* 不是很開心 (6)\n\n\n## (5) \n\n看起來你是個不錯的對話者，一起來看看其他對話者怎麼想吧！\n\n* [點我看影片](https://newmedia.pts.org.tw/fans-talk/)\n\n\n## (6) \n\n你認為跟你立場不同的粉絲有哪些特徵？（可複選）\n\n<div>\n<ul class=\"c-field__input c-checkbox-list\">\n\t<li class=\"c-checkbox-list__item c-checkbox\">\n    \t<input type=\"checkbox\" class=\"c-checkbox__input\" id=\"check-1\" name=\"checkexample\" checked>\n     \t<label class=\"c-checkbox__label\" for=\"check-1\">理性的<\/label>\n    <\/li>\n    <li class=\"c-checkbox-list__item c-checkbox\">\n     \t <input type=\"checkbox\" class=\"c-checkbox__input\" id=\"check-2\" name=\"checkexample\">\n    \t <label class=\"c-checkbox__label\" for=\"check-2\">不理性的<\/label>\n    <\/li>\n    <li class=\"c-checkbox-list__item c-checkbox\">\n      \t<input type=\"checkbox\" class=\"c-checkbox__input\" id=\"check-3\" name=\"checkexample\">\n      \t<label class=\"c-checkbox__label\" for=\"check-3\">親中的<\/label>\n    <\/li>\n     <li class=\"c-checkbox-list__item c-checkbox\">\n      \t<input type=\"checkbox\" class=\"c-checkbox__input\" id=\"check-4\" name=\"checkexample\">\n     \t<label class=\"c-checkbox__label\" for=\"check-4\">反中的<\/label>\n    <\/li>\n     <li class=\"c-checkbox-list__item c-checkbox\">\n     \t <input type=\"checkbox\" class=\"c-checkbox__input\" id=\"check-5\" name=\"checkexample\">\n      \t<label class=\"c-checkbox__label\" for=\"check-5\">追求穩定的<\/label>\n    <\/li>\n     <li class=\"c-checkbox-list__item c-checkbox\">\n      \t<input type=\"checkbox\" class=\"c-checkbox__input\" id=\"check-6\" name=\"checkexample\">\n      \t<label class=\"c-checkbox__label\" for=\"check-6\">想要改革的<\/label>\n    <\/li>\n     <li class=\"c-checkbox-list__item c-checkbox\">\n      \t<input type=\"checkbox\" class=\"c-checkbox__input\" id=\"check-7\" name=\"checkexample\">\n      \t<label class=\"c-checkbox__label\" for=\"check-7\">既得利益者<\/label>\n    <\/li>\n     <li class=\"c-checkbox-list__item c-checkbox\">\n     \t <input type=\"checkbox\" class=\"c-checkbox__input\" id=\"check-8\" name=\"checkexample\">\n    \t <label class=\"c-checkbox__label\" for=\"check-8\">政治受害者<\/label>\n    <\/li>\n     <li class=\"c-checkbox-list__item c-checkbox\">\n      \t<input type=\"checkbox\" class=\"c-checkbox__input\" id=\"check-9\" name=\"checkexample\">\n      \t<label class=\"c-checkbox__label\" for=\"check-9\">較少危機感的<\/label>\n    <\/li>\n     <li class=\"c-checkbox-list__item c-checkbox\">\n      \t<input type=\"checkbox\" class=\"c-checkbox__input\" id=\"check-10\" name=\"checkexample\">\n      \t<label class=\"c-checkbox__label\" for=\"check-10\">樂觀的<\/label>\n    <\/li>\n     <li class=\"c-checkbox-list__item c-checkbox\">\n      \t<input type=\"checkbox\" class=\"c-checkbox__input\" id=\"check-11\" name=\"checkexample\">\n      \t<label class=\"c-checkbox__label\" for=\"check-11\">思想開放的<\/label>\n    <\/li>\n    <li class=\"c-checkbox-list__item c-checkbox\">\n      \t<input type=\"checkbox\" class=\"c-checkbox__input\" id=\"check-12\" name=\"checkexample\">\n      \t<label class=\"c-checkbox__label\" for=\"check-12\">思想封閉的<\/label>\n    <\/li>\n    <li class=\"c-checkbox-list__item c-checkbox\">\n      \t<input type=\"checkbox\" class=\"c-checkbox__input\" id=\"check-13\" name=\"checkexample\">\n      \t<label class=\"c-checkbox__label\" for=\"check-13\">盲從的<\/label>\n    <\/li>\n    <li class=\"c-checkbox-list__item c-checkbox\">\n      \t<input type=\"checkbox\" class=\"c-checkbox__input\" id=\"check-14\" name=\"checkexample\">\n      \t<label class=\"c-checkbox__label\" for=\"check-14\">吸收多元資訊的<\/label>\n    <\/li>\n    <li class=\"c-checkbox-list__item c-checkbox\">\n      \t<input type=\"checkbox\" class=\"c-checkbox__input\" id=\"check-15\" name=\"checkexample\">\n      \t<label class=\"c-checkbox__label\" for=\"check-15\">激進的<\/label>\n    <\/li>\n    <li class=\"c-checkbox-list__item c-checkbox\">\n      \t<input type=\"checkbox\" class=\"c-checkbox__input\" id=\"check-16\" name=\"checkexample\">\n      \t<label class=\"c-checkbox__label\" for=\"check-16\">會反思的<\/label>\n    <\/li>\n<\/ul>\n<\/div>   \n* 我想好了 (1)\n"},"style":{"
